Has new as of last season;
Battery, tires, oil, oil filter, exhaust manifold gasgets, drive sprocket, and chain.

Needs;
Clutch, carbs cleaned, spindle to connect the speedometer wire to the speedometer, and right hand front turn signal cover (has a new cover on it but its for the rear so its not the correct cover).

Comes with; 
saddle bags, small bag on the front forks, gps (so you know your speed), and the original front faring and windshield (have never seen it on the bike and I dont think I have all the hardware to install but its there).
